// Convert to get the price from any Chainlink price feed
// oracle address for a token will be 0x0 if the feed has not been added to the contract
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.6/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

abstract contract IERC20x is IERC20
{
    function decimals() public virtual view returns(uint8);
}

contract PriceConsumerV3 is Ownable {
    AggregatorV3Interface internal priceFeed;

    address private constant LINK_KOVAN = 0xa36085F69e2889c224210F603D836748e7dC0088;
    address private constant LINK_KOVAN_ORACLE = 0x2c1d072e956AFFC0D435Cb7AC38EF18d24d9127c;
    address private constant LINK_RINKEBY = 0x01BE23585060835E02B77ef475b0Cc51aA1e0709;
    address private constant LINK_RINKEBY_ORACLE = 0xd8bD0a1cB028a31AA859A21A3758685a95dE4623;

    mapping(address => address) private oracle_addresses;       // Map addresses of tokens to Chainlink oracle addresses

    constructor() public {
        //priceFeed = AggregatorV3Interface(oracle);
        oracle_addresses[LINK_RINKEBY] = LINK_RINKEBY_ORACLE;      
        //oracle_address[DAI_RINKEBY] = DAI_RINKEBY_ORACLE; // Need to change all Kovan addresses to Rinkeby, since we're planning on using Compound protocol
    }

    /**
     * Returns the latest price
     */
    function getTokenPrice(address token) public returns (int) 
    {
        address oracle;

        if (!oracleAvailable(token))
        {
            return 0;
        }

        require(IERC20x(token).decimals() == 18, "Only ERC20 tokens with 18 decimals may be used"); // Going to have to use old version of IERC20 since Chainlink is 0.6.7. True or not? Can we compile for different versions of Solidity in the same project?
        oracle = oracle_addresses[token];
        priceFeed = AggregatorV3Interface(oracle);
        (
            uint80 roundID, 
            int price,
            uint startedAt,
            uint timeStamp,
            uint80 answeredInRound
        ) = priceFeed.latestRoundData();
        return price;
    }

    // oracleAvailable returns 'true' if the token's oracle has been added to the mapping. 'false' if not.
    function oracleAvailable (address token) 
        private 
        returns(bool)
    {
        if (oracle_addresses[token] == address(0x0))
        {
            return false;
        }
        else if (oracle_addresses[token] != address(0x0))
        {
            return true;
        }
    }

    function addOracle (address token, address oracle)
        public
        onlyOwner
    {
        oracle_addresses[token] == oracle;
    }

    function delOracle (address token, address oracle)
        public
        onlyOwner
    {
        oracle_addresses[token] == address(0x0);
    }
}

